import Vue from 'vue';
import Router from 'vue-router'; //路由字典中添加每个组件的路由

import Index from './views/index.vue';
import Login from './views/login.vue';
import Details from './views/details.vue';
import notFound from './views/notFound.vue';
import Product from './views/product.vue';
import Register from './views/register.vue';
import Customer from './views/customer.vue';
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    component: Index
  }, {
    path: '/Index',
    component: Index
  }, {
    path: "/Login",
    component: Login
  }, {
    path: "/Details",
    component: Details
  }, {
    path: "/Product",
    component: Product
  }, {
    path: "*",
    component: notFound
  }, {
    path: "/Register",
    component: Register
  }, {
    path: "/Customer",
    component: Customer
  }]
});
